import React from 'react';
import styled from 'styled-components';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

const StyledIcon = styled.div`
  display: inline-flex;
  align-items: center;
  justify-content: center;
  
  svg {
    font-size: 1.2rem;
  }
`;

// Criando componentes de ícone como elementos React
const createIconComponent = (IconComponent) => {
  const IconWrapper = () => (
    <StyledIcon>
      <IconComponent />
    </StyledIcon>
  );
  IconWrapper.displayName = IconComponent.displayName || 'IconWrapper';
  return IconWrapper;
};

export const SearchIcon = createIconComponent(BsSearch);
export const ChartIcon = createIconComponent(BsBarChart);
export const GearIcon = createIconComponent(BsGear);
export const FileIcon = createIconComponent(BsFileText);
export const FilterIcon = createIconComponent(BsFilter);
export const SaveIcon = createIconComponent(BsSave);
export const TrashIcon = createIconComponent(BsTrash);
